import {Routes,Route} from 'react-router-dom'
import'./pages/Layout';
import './App.css';

function App() {
  return (

      <div class="App">
        <h1>Rutas</h1>
        <Routes>
          <Route path="/" element={<Layout/>}/>
        </Routes>
      </div>

  )
}

export default App;
